description:
Season 3, Episode 1 - &quot;Guns A Blazin&quot;
Billy Leroy sports a look of confidence while attending the &quot;cowboy auction&quot; preview in Stockton, CA.  Items from the Wild West; a leather belt tied to legendary cowboy Buffalo Bill.

Season 3, Episode 2 - &quot;Mike Tysons Punch Out&quot;
The auction specialists travel south to Jacksonville, FL, where they go head-to-head over Mike Tyson, the Incredible Hulk and Han Solo.

Season 3, Episode 3 - &quot;Bunny Money&quot;
The auction specialists head to Denver, hoping for a Rocky Mountain High profit. Billy and Mark scuffle over an authentic German World War II item, and one buyer gets excited after finding an original Playboy Bunny costume.

Season 3, Episode 4 - &quot;Golden Ticket&quot;
The auction specialists travel to Nashville, TN, where pop-culture memorabilia can be found everywhere. One buyer scores a &quot;Golden Ticket&quot; after finding a Willy Wonka candy bar.

Season 3, Episode 5 - &quot;Blow Up&quot;
The auction specialists attend an unclaimed crate auction in the Arizona desert, and things really heat up when one buyer tests a vintage bomb detonator using real explosives.
